CREATE TABLE [dbo].[location_new]
(
[Id] INT NOT NULL PRIMARY KEY IDENTITY(1,1),
[Suburb] VARCHAR(MAX) NOT NULL,
[Offence_rate] NUMERIC(10,8) NOT NULL,
[Risklevel] NUMERIC(10,8) NOT NULL,
[Latitude] NUMERIC(10, 8) NOT NULL,
[Longitude] NUMERIC(11, 8) NOT NULL,
[Postcode] VARCHAR(10) NOT NULL,
CONSTRAINT CK_Latitude CHECK (Latitude >= -90 AND Latitude <= 90),
CONSTRAINT CK_Longtitude CHECK (Longitude >= -180 AND Longitude <= 180)
)
